import React from 'react';
import './Cell.css';

class Cell extends React.Component {
    getColor(value) {
        const colorNames = [
            "White",
            "Snow",
            "Light Pink",
            "Pink",
            "Light Salmon",
            "Salmon",
            "Indian Red",
            "Firebrick",
            "Brown"
        ];

        return "White"
        // colors[value].rgb;
    }

    render() {  
        const divStyle = {
            backgroundColor: this.getColor(this.props.number),
        };

        return (
            <div
                style={divStyle}
                className="cell"
            >
                {this.props.number}
            </div>
        );
    }
}

export default Cell;
